import React, { useEffect, useState, useCallback } from 'react'

const Home = () => {
  const [exercisesSessions, setExercisesSessions] = useState([])

  const getExercisesSessions = useCallback(async () => {
    await fetch('http://localhost:8000/api/exercisesSessions/1')
            .then(res => res.json())
            .then(data => setExercisesSessions(data))

    console.log('get')
  }, [])

  useEffect(() => {
    getExercisesSessions()
      .catch(console.error)

  }, [getExercisesSessions])

  return (
    <div>
      {exercisesSessions?.length > 0 ? (
        exercisesSessions.map(ex => (
          <h1>{ex.name}</h1>
        ))
      ) : (
        <h1>No hay registros</h1>
      )}
    </div>
  )
}

export default Home
